import React from "react";

function PersonDetails({ person }) {
    
  return (
    <div>
      <h3>{person.name}</h3>
      <p>Age: {person.age}</p>
      <p>Occupation: {person.occupation}</p>
    </div>
  );
}

export default PersonDetails;
